import React, { useState, useEffect } from "react";
import { Link } from 'react-router-dom'
import { Helmet } from 'react-helmet'
import NavigationLinks from '../components/navigation-links'
import projectStyles from '../style.module.css'
import styles from './home.module.css'
import { useHistory } from 'react-router-dom/cjs/react-router-dom.min'
import { useDispatch,useSelector } from "react-redux";
import { logout } from "../actions/userActions";
import {
  Container,
  Form,
  FormControl,
  Nav,
  Navbar,
  NavDropdown,
} from "react-bootstrap";

const Home = () => {
  const history = useHistory();
  const dispatch = useDispatch();

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const logoutHandler = () => {
    dispatch(logout());
  };

  useEffect(() => {}, [userInfo]);
  return (
    <div className={styles['container']}>
          <header className={styles['Header']}>
          <Navbar collapseOnSelect expand="lg" bg="primary" variant="dark">
        <Container>
        <Navbar.Brand href="/">Welcome to Model Trading System</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="m-auto">
            {userInfo && (
              <Form inline>
                <FormControl
                  type="text"
                  placeholder="Search"
                  className="mr-sm-2"
                  onChange={(e) => setSearch(e.target.value)}
                />
              </Form>
            )}
          </Nav>
        <Nav>
            {userInfo ? (
              <>
                <Nav.Link href="/">Home page</Nav.Link>
                <NavDropdown
                  title={`${userInfo.name}`}
                  id="collasible-nav-dropdown"
                >
                  <NavDropdown.Item href="/user-file-page">
                    {/* <img
                      alt=""
                      src={`${userInfo.pic}`}
                      width="25"
                      height="25"
                      style={{ marginRight: 10 }}
                    /> */}
                    My Profile
                  </NavDropdown.Item>

                  <NavDropdown.Divider />
                  <NavDropdown.Item onClick={logoutHandler}>
                    Logout
                  </NavDropdown.Item>
                </NavDropdown>
              </>
            ) : (
              <Nav.Link href="/login-page">Login</Nav.Link>
            )}
          </Nav>
        </Navbar.Collapse>
        <Link
          to="/sell-goods-page"
          className={` ${styles['navlink1']} ${projectStyles['button']} `}
        >
          Sell
        </Link>
        </Container>
      </Navbar>
      </header>
      {/* <div className={styles['BtnGroup']}> */}
      {/* <Typography  className={classes.title}> */}

      {/* </div> */}

      <video
        src
        poster="https://play.teleporthq.io/static/svg/videoposter.svg"
        className={styles['video']}
      ></video>
      <h1 className={styles['text']}>Best-selling models</h1>
      <div className={styles['container2']}>
        <Link to="/goods-details-page" className={styles['navlink2']}>
          <img
            alt="image"
            src="https://play.teleporthq.io/static/svg/default-img.svg"
            className={styles['image']}
          />
        </Link>
        <span className={styles['text1']}>goods name</span>
        <span className={styles['text2']}>$999</span>
      </div>
    </div>
  )
}

export default Home
